import { Link } from 'react-router-dom';
import { Card } from 'react-bootstrap';

const Bike = ({ bike }) => {
  return (
    <Card className="my-3 p-3 rounded">
      <Card.Body>
        <Card.Title as="div">
          <strong>{bike.model}</strong>
        </Card.Title>
      </Card.Body>
    </Card>
  );
};

export default Bike;
